import React from 'react';
import { useHistory } from 'react-router-dom';

function Project1() {
    const history = useHistory();
  
    const handleNext = () => {
      history.push('/project2');
    };
  
    return (
      <div className='Project1'>
        <h1>Project1</h1>
        <button onClick={handleNext}>Next</button>
      </div>
    );
  }
  

export default Project1;
